insert  into `li_articles`(`id`,`catid`,`title`,`thumb`,`describe`,`content`,`source`,`url`,`status`,`sort`,`created_at`,`updated_at`) values (1,2,'食品的创意广告','/upload/attrs/20170426/20170426025559900.jpg',NULL,'<p>\r\n  <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <a href=\"http://demo.wpcom.cn/third/234.html\" title=\"食品的创意广告\" style=\"box-sizing:border-box;background-color:#FFFFFF;color:#333333;text-decoration-line:none;outline:0px;display:block;text-overflow:ellipsis;overflow:hidden;word-wrap:normal;font-family:\" font-size:14px;text-align:center;\"=\"\"><br />\r\n</a> \r\n</p>\r\n<p>\r\n <a href=\"http://demo.wpcom.cn/third/234.html\" title=\"食品的创意广告\" style=\"box-sizing:border-box;background-color:#FFFFFF;color:#333333;text-decoration-line:none;outline:0px;display:block;text-overflow:ellipsis;overflow:hidden;word-wrap:normal;font-family:\" font-size:14px;text-align:center;\"=\"\"><img class=\"aligncenter size-full wp-image-241\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2016/02/50473693c45280b1a3b5e075f7975b57d5a93e1e13ed6-omBILt_fw658.jpg\" alt=\"50473693c45280b1a3b5e075f7975b57d5a93e1e13ed6-omBILt_fw658\" width=\"600\" height=\"848\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\"></a> \r\n</p>\r\n<p>\r\n  <br />\r\n</p>\r\n<a href=\"http://demo.wpcom.cn/third/234.html\" title=\"食品的创意广告\" style=\"box-sizing:border-box;background-color:#FFFFFF;color:#333333;text-decoration-line:none;outline:0px;display:block;text-overflow:ellipsis;overflow:hidden;word-wrap:normal;font-family:\" font-size:14px;text-align:center;\"=\"\"><br />\r\n</a> \r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <br />\r\n</p>',NULL,'shi-pin-de-chuang-yi-guang-gao',1,0,'2017-04-26 02:57:01','2017-04-26 02:57:19'),(2,2,'日本海报分享','/upload/attrs/20170426/20170426025746572.jpeg',NULL,'<img class=\"aligncenter size-full wp-image-223\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/f01f3aac2eb89d541be9007e1164051201f91361232da-zMszpS_fw658.jpeg\" alt=\"f01f3aac2eb89d541be9007e1164051201f91361232da-zMszpS_fw658\" width=\"470\" height=\"662\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\" />',NULL,'ri-ben-hai-bao-fen-xiang',1,0,'2017-04-26 02:57:50','2017-04-26 02:57:50'),(3,2,'Poster Annual 2015海报设计获奖作品','/upload/attrs/20170426/20170426025817159.jpeg',NULL,'<img class=\"aligncenter size-full wp-image-219\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/4eff559b17b2b85435c8bb62198896414968572f16a95-Jpnb3e_fw658.jpeg\" alt=\"4eff559b17b2b85435c8bb62198896414968572f16a95-Jpnb3e_fw658\" width=\"658\" height=\"933\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\" />',NULL,'Poster-Annual-2015-hai-bao-she-ji-huo-jiang-zuo-pin',1,0,'2017-04-26 02:58:20','2017-04-26 02:58:20'),(4,2,'充满创意的包装设计作品欣赏','/upload/attrs/20170426/20170426025856717.jpg',NULL,'<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  <img class=\"alignnone size-full wp-image-21 aligncenter\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-1.jpg\" alt=\"Designs-1\" width=\"600\" height=\"452\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n <img class=\"aligncenter size-full wp-image-239\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-2.jpg\" alt=\"Designs-2\" width=\"600\" height=\"448\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n  <img class=\"alignnone size-full wp-image-23\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-3.jpg\" alt=\"Designs-3\" width=\"599\" height=\"747\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n <img class=\"alignnone size-full wp-image-24\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-4.jpg\" alt=\"Designs-4\" width=\"600\" height=\"574\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n <img class=\"alignnone size-full wp-image-25\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-5.jpg\" alt=\"Designs-5\" width=\"600\" height=\"450\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n <img class=\"alignnone size-full wp-image-26\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-6.jpg\" alt=\"Designs-6\" width=\"596\" height=\"532\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n <img class=\"alignnone size-full wp-image-27\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-7.jpg\" alt=\"Designs-7\" width=\"600\" height=\"285\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n <img class=\"alignnone size-full wp-image-28 aligncenter\" src=\"http://demo.wpcom.cn/third/wp-content/uploads/sites/4/2015/06/Designs-8.jpg\" alt=\"Designs-8\" width=\"600\" height=\"435\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;\" />\r\n</p>',NULL,'chong-man-chuang-yi-de-bao-zhuang-she-ji-zuo-pin-xin-shang',1,0,'2017-04-26 02:58:59','2017-04-26 02:58:59'),(5,3,'互联网金融：烫手的牌照','/upload/attrs/20170426/20170426025921737.jpeg',NULL,'<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 东方网记者朱恬6月26日报道：随着互联网金融的兴起，相应的牌照是否会逐步放开？互联网金融牌照又有何意义？在2015陆家嘴论坛浦江夜话环节中，互联网金融专家对此发表了看法。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n <img class=\" aligncenter\" src=\"http://sh.eastday.com/images/thumbnailimg/month_1506/201506271030439311.jpg\" alt=\"\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n  图片说明：汇付天下董事长兼CEO周晔。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 汇付天下董事长周晔坦言，目前的行业对互联网金融牌照普遍持两种态度，一种是特别想拿到牌照，拿着这张牌照就能踏实经营，防止被同行牵连；另一种是害怕拿牌照，因为牌照意味着束缚。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n <img class=\" aligncenter\" src=\"http://sh.eastday.com/images/thumbnailimg/month_1506/201506271030434867.jpg\" alt=\"\" style=\"box-sizing:border-box;vertical-align:top;max-width:100%;height:auto;display:block;margin:0px auto;\" />\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;text-align:center;\">\r\n  图片说明：点融网联合首席执行官、共同创始人郭宇航。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 点融网联合首席执行官郭宇航则认为，作为一个新生的业态，暂缓发牌照更有利于行业发展，“牌照意味着原则、束缚。比如说发放牌照的小贷公司都规定了严格的杠杆比例，而P2P没有，几乎是无限杠杆做业务。但同时没有牌照不代表不要监管。我认为监管是非常必要的，一定要尽快落地。因为在没有牌照的初期广大想要规范做P2P的公司有大量的发挥空间，央行对于牌照公司的严格审查导致了支付公司在创新上受到遏制。”\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  郭宇航还透露，第三方支付发放牌照有300张，然而真正能够活跃经营的不到100张，大量的牌照在市场上进行转让，“有钱就可以买到的牌照，究竟有多大的监管意义呢？”因此，互联网金融的监管不应该参照传统的金融机构的牌照管理，而是对于越轨的事情及时出台政策，小步快走监管。同时用互联网方式监管，要求互联网金融公司向监管部门开放，用技术进行监管，一旦发生违规行为，可以在银监会上公示这些企业，通过影响声誉的方式进行惩罚，这或许是互联网金融监管的未来。\r\n</p>',NULL,'hu-lian-wang-jin-rong-tang-shou-de-pai-zhao',1,0,'2017-04-26 02:59:34','2017-04-26 02:59:34'),(6,3,'雇佣制过时了，打造你的人才联盟！',NULL,NULL,'<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 二十多年前，中国的国有企业和政府机关的工作大都很稳定，只有你不犯大错误，就可以作为“单位人”一直工作下去。1992年随着市场经济体制的确立，这种事实上的“终身雇佣制”受到了来自外企和民企的冲击，“自由雇佣制”和市场经济被想当然地联系在一起。所谓“自由雇佣”，就是作为个人有选择雇主的自由，但如果雇主对某个雇员不满，他可以以某个理由解雇这名雇员。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 自由雇佣制催生了大量的猎头和招聘公司。人才开始在各大公司之间高速流动，越来越少的人一辈子只在一家公司工作。企业不再保证会给雇员一个长期稳定的职位，而个人也大多数没想到要在一家企业工作一辈子。你看现在各种各样的互联网招聘公司的广告，创意大都是一样的：对老板不满意？想要更大发展？想要更高薪水？上某某网，更好的职位在等着你！更高的薪水在等着你！\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 这种公司和个人之间的自由雇佣关系优化了人力资源配置，但也带来了一些负面效应，那就是公司和个人之间的信任和忠诚都大幅下降。由于缺乏组织忠诚度，很多人总想着一有机会就跳槽，而一些公司则不愿意培养人，他们的逻辑也很简单：好不容易培养了一个人，别人给高一点的薪水就走了。于是乎，公司在失去高潜力人才，而人才也无法充分投入工作，而是在市场藏上不断寻找机会。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  老路已经无法回去了。终身雇佣制这种传统模式非常适合相对稳定的时期，但它对于当今的网络时代来说太过死板，不再适合现在不断变革的宏观环境。几乎没有公司能继续为员工提供传统的职业晋升阶梯，就算以“终身雇佣制”见长的日本企业，在糟糕的宏观经济环境下，很多企业也不得不开始裁员。在这种环境中，要求员工和公司保持长期关系是不现实的，彼此之间的忠诚更是罕见。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 有没有什么办法在保持自由雇佣制的弹性基础上，又让员工和公司之间保持相互信任和忠诚关系呢？至少在一个阶段内如此。领英（Linkedin）的创始人里德·霍夫曼基于他的观察和实践，提出了一个新的人才策略框架：使雇主与员工之间的关系从商业交易转变为互惠关系的联盟，这种雇佣联盟关系为管理者和员工提供了建立信任、进行投资，以建设强大企业和成功事业所需的框架。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 这种互惠关系需要把心照不宣的心理契约书面化。雇主需要告诉员工：“只要你让我们的公司更有价值，我们就会让你更有价值。”员工需要告诉他们的老板：“如果公司帮助我的事业发展壮大，我就会帮助公司发展壮大。”于是，员工致力于帮助公司取得成功，而公司致力于提高员工的市场价值。通过建立互惠的联盟，雇主和员工可以投资于这段关系，并承担其中可能发生的一些的风险。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  比如说，当老板和人力资源主管为了培养一个人花了很多钱在培训项目上，却看到这个人在参加完培训几个月之后就离职，反应自然是有些沮丧。但如果因此就去削减培训预算，又不能为组织发展提供持久的推动力。这个时候，比较理想的方式是公司和个人都开诚布公地设定各自的预期：员工可以表达自己想要发展的技能以及他对公司的承诺，而公司则可以明确表达他的投资以及期望回报。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  其实里德.霍夫曼的这种提法在学理上并不新鲜，在组织行为学的教科书中就有提及：组织存在的目的在于让一群人一起完成一个共同的目标。一个组织就像一个职业球队，每个球员都有明确的目标（比如说赢得比赛），队员为了实现这个目标聚到一起，各自既有分工也有协作。只有当队员们彼此信任，将团队成就置于个人成就之上时，团队才会胜利。团队胜利也是队员实现个人成就的最佳方式，胜利队伍的队员会被其他队争相求购，他们的职业价值也随之提升。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 尽管职业球队不采用终身雇佣制，但相互信任、相互投资、共同受益的原则仍然适用。只有当队员们彼此非常信任，将团队成就置于个人成就之上时，团队才会胜利。而团队胜利是队员实现个人成就的最佳方式。胜利队伍的队员会被其他队争相求购，它们看中的既有这些队员展现出的技能，也有他们帮助新队伍建立胜利文化的能力。可以说，团队和球员在赢得比赛这件事情是真正的双赢。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 当然在中国，这种联盟的人才策略也需要做一些本地化的调整。虽然公司不是家庭，无需刻意营造一种温情脉脉的家庭氛围，但组织成员之间的相互关心和欣赏依然是必要的，它能增强人对组织的情感归属。另外，对于那些已经离开公司的员工，公司和员工之间的关系也并非因此而结束。他们可以保持像朋友一样经常联系，这种人力资源网络就像社会资本一样，能给双方带来互惠互利。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  在一个快速变化的年代，我们已经没有办法“终身雇佣”了，公司和员工都需要一定的弹性。公司无法假装温情脉脉地说“公司就是家，我们是家人”，员工也无需假装表态“生是公司人、死是公司鬼”。但公司和员工在约定时间内的相互忠诚依然是必要的，因为没有这种忠诚度就无法长期考虑和投资未来。人才联盟制能很好地解决这个问题：它让公司和个人达成一个心理契约，让双方都专注于中长期收益，为公司带来更多创新、韧性和适应性，实现真正的双赢。\r\n</p>',NULL,'gu-yong-zhi-guo-shi-le-da-zao-ni-de-ren-cai-lian-meng',1,0,'2017-04-26 03:00:02','2017-04-26 03:00:02'),(7,3,'首届移动互联网创业峰会聚焦移动支付',NULL,NULL,'<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  中新网厦门6月27日电 (记者 杨伏山)首届“移动互联网创业峰会”27日在厦门举办，来自社会各界的企业家、品牌规划家、战略投资家、个体营业主和关注移动互联网商业人士300余人参会，聚焦互联网时代移动支付新趋势。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 据介绍，全球52亿移动用户中，目前仅有30%的智能手机使用率，剩余70%的广阔市场仍待挖掘。随着通信技术的不断高速发展和普及，中国移动互联网迅速起飞，目前，中国移动互联网用户数已达到中国互联网用户数的八成，中国有望主导未来移动商务革命。&emsp;&emsp;由中金汇通金融技术服务有限公司主办的是次峰会，邀请多位互联网业界人士到会分享经验，畅谈移动互联网趋势下热门行业的兴起以及如何把握移动互联网带来的商机。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 与会业界人士认为，中国移动互联网强劲发展态势2015年将延续，而移动支付则是发展的必要基础。可以预见，未来现金及银行卡交易将逐步被移动支付所取代。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n 移动支付未来的商业形态有很多种，比如大数据，利用海量的用户支付数据，以此为基础，进行精准营销，获得任何时代都无法企及的高性价比营销收入；比如未来微商，所有人都可能是微商店主，都需要资金交易，因此移动支付的普及将会带来巨额财富，今后势必成为各商家争夺的重点。\r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;text-indent:2em;color:#333333;font-family:&quot;font-size:14px;white-space:normal;background-color:#FFFFFF;\">\r\n  主办方称，期盼峰会的举办有助于使移动支付能够为更多人所认识并带来利益，从而促进大众创业，万众创新。(完)\r\n</p>',NULL,'shou-jie-yi-dong-hu-lian-wang-chuang-ye-feng-hui-ju-jiao-yi-dong-zhi-fu',1,0,'2017-04-26 03:00:20','2017-04-26 03:00:20'),(8,3,'去中心化：微信抄袭泛滥的原罪？',NULL,'如今微信公众号抄袭泛滥已经是不争的事实，早在今年初，新华社就已发文批判微信公众号抄袭严重，各媒体也呼吁“别让‘抄袭风’毁了微信平','<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 如今微信公众号抄袭泛滥已经是不争的事实，早在今年初，新华社就已发文批判微信公众号抄袭严重，各媒体也呼吁“别让‘抄袭风’毁了微信平台。今年5月份，上海律师朱斌提交的微信公众号抄袭的起诉状已被立案，书面受理通知已经发出，国内首起针对公众号抄袭的案例维权也即将启动。\r\n  </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 关于微信公众号，圈内有句话叫“1人原创，99人抄袭。”笔者最近多次在微信搜索本人文章标题，每篇文章的搜索结果达到几十到几百条不等，大号往往会署名，小号直接抄，不署名或者署上其他人的名字，然后改掉出处的比比皆是。如果要一个个去维权，可能耗费巨大的精力与时间，因此，有时候抓到有知名度的大V抄袭或转载会要求其删稿，但在看到一大波未授权的搜索结果的时候，有时候只能一声叹息。对于微信抄袭现象痛恨但无能为力，这可能是很多原创者共有的悲哀。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n  目前，微信对公众平台泛滥的抄袭现状也开始有整顿措施，比如发布了处罚规则，侵权达五次将永久封号。另一方面，微信公众平台正式上线“原创声明”功能，第一批公测对象为微信认证的媒体类型公众账号。申请“原创声明”的文章发布后，“原创声明”系统会对会自动注明出处。微信内部有同学向笔者表示，目前仍是原创声明、评论、页面模板合成“原创保护”,按照原创度、原创文章数、注册时间筛选出符合条件的公众帐号，符合条件的帐号即可收到开通通知。\r\n </p>\r\n<h2 style=\"box-sizing:border-box;font-family:\" font-weight:500;line-height:1.1;color:#333333;margin-top:20px;margin-bottom:10px;font-size:30px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 去中心化意味着无为而治缺乏监控&nbsp;流量驱动导致泥沙俱下抄袭泛滥\r\n   </h2>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n  是什么造就了微信公众号抄袭的泛滥？这个我们从微信的去中心化去追溯。微信本质是一个中心化的平台，而微信公众平台是微信服务平台的一端，其本质是需要满足人们对各垂直领域多样化的阅读需求，所以把这部分平台开放出来，让各领域具备“认知盈余”的各类人进入平台提供垂直领域特色的资讯，这就是去中心化。\r\n     </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 去中心化导致的一个结果首先在于微信公众号账号开设的门槛低。可以说，任何人都可以开设公众账号，而公众账号运营者背后的动机无疑就是寄希望该账号形成巨大的粉丝量，进而通过流量变现。利益驱动导致微信公众号粗放式的扩张，泥沙俱下，平台的监管在此时已经难以跟进。\r\n   </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 张小龙曾经阐述微信的去中心化，他希望微信成为一座森林，而不是自建宫殿，所有的生物或者动植物能够在森林里面自由生长，而不是微信自己去建造。这个比喻很好的阐述了去中心化，即微信并不去引导、强设置一个中心化的流量入口来对接公众平台方、第三方。微信是通过无为而治，不引导不设限，让内容与用户行为在其中自由生长，让第三方去中心化地组织自己的客户。\r\n      </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 这导致的结果就是，所有人都必须自己去找流量与用户。流量与用户的来源对于小部分人来说，是来自于个人影响力，比如原微博大V可以通过引导将粉丝导入自身公众号，这部分人很容易可以形成海量粉丝。对于大部分公众号来说，找流量找客户，首先就要找内容。\r\n    </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 通过内容引导关注者分享，形成粉丝吸附力，这是完成利润创收的前提（比如微信公众号流量主开通需要5万粉丝）。但事实上，如前面所述，微信公众号没有任何门槛，结果是许多没有原创能力的公众号运营者都参与了进来，即便对这些抄袭者设置各种处罚条例，依然阻挡了这部分人对内容的复制搬运，这部分运营者如果不去抄袭、转载、搬运，他们的公众号便会荒芜。\r\n     </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 去中心化意味着微信公众号需要跟第三方一起来共同建造一个系统，这个系统的长盛不衰需要将优质内容源源不断的流动触达用户，而微信的去中心化的本质是不推荐、不引导、不监控，这决定了其对内容的放任姿态，在张小龙看来，没有平等话语权的平台里，很难有所谓的用户价值。这只对了一半，去中心化可以让优质内容脱颖而出，但事实上未必可以让优质内容创造者脱颖而出。\r\n    </p>\r\n<h2 style=\"box-sizing:border-box;font-family:\" font-weight:500;line-height:1.1;color:#333333;margin-top:20px;margin-bottom:10px;font-size:30px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 流量生意与去中心化的本质目的产生矛盾&nbsp;&nbsp;原创内容生产者的价值被忽视\r\n </h2>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n  虽然腾讯希望广大合作者能够借助微信平台的巨大能力，实现自身的成长，并同时反哺这个平台。但微信的流量机制又在倾向于扶持垂直领域的一个个中心化的流量个体，推动粉丝与流量的中心化。这里我们看到，微信引入广点通，为粉丝过5万的公众号开通流量主功能匹配流量广告，间接扶持内部的流量中心。\r\n</p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 流量中心不等于优质原创内容中心。在广点通正式放开之后，由于微信公众平台的去中心化形态，那些真正能生产优质原创内容但缺乏粉丝的自媒体，并不能从微信获得中心化的入口曝光与推荐。因为绝大多数有资格试水广点通的公众号以粉丝数为评判标准，这其中，去中心化的自然生长的机制孕育出许多复制粘贴党，变相掠夺别人的文章或内容充实自身的粉丝与流量与收入，并不断变相伤害原创作者本身的内容制造动力与价值释放。\r\n </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 这里看出，微信生态是一个矛盾的综合体。腾讯是做流量生意，流量生意的本质是将内容变现，广点通接入微信之后，即流量资源提供方对应自媒体运营者，共同向广告主收费，但从根本上，公众号导入的流量都被微信吸收。当优质内容被各个中心化的大号轻易拿去换取流量资源时，许多内容创造者的价值被践踏，因为并不是每个优质内容创造者都拥有粉丝号召力，而前面提到原创保护机制，事实上有极高门槛，将这部分原创者的版权保护权利被剥夺，这套机制反过来让原创者的优质文章等内容为其他拥有海量粉丝的大号做了嫁衣。从这里看，微信公众平台生态圈正在不可避免走在微博这种扶持大V的老路上。\r\n</p>\r\n<h2 style=\"box-sizing:border-box;font-family:\" font-weight:500;line-height:1.1;color:#333333;margin-top:20px;margin-bottom:10px;font-size:30px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 微信公众平台的稳定性需要中心化与去中心化的结合\r\n </h2>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n  张小龙曾经说过，如果没有关注任何公众号的话，可能看不到任何公众号的存在，微信并没有一个中心入口来提供给他们，这是去中心化在微信里面的一种体现。\r\n   </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 根据凯文凯利《失控》一书中论述的去中心化的观点就是：它没有强制性的中心控制，次级单位具有自治的特质，并且次级单位之间彼此高度连接。其中的优点很明显，表现为适应性强、可进化性、弹性、无限性、可以放大结果。所以对应到微信，张小龙就说到，每天有近千万的公众号，在微信里面很活跃，他们的活跃是他们通过自身的努力带来的。这里体现出成千上万的公众号的自适应性与无限性的增长可能，我们也看到微信的去中心化机制导致微信公众号迅速形成的指数级别增长。\r\n  </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 但缺点也很明显，就是不可控、不可预测、不可知。优质的原创内容、劣势的谣言、不可避免的版权侵权、不可阻挡的大量抄袭、人云亦云的鸡汤也从中不断涌现诞生这些负面效应不可避免也会对微信产生伤害力。\r\n    </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 去中心化可以对应到我国古代道家的思维本质。《道德经》里面讲：人法地，地法天，天法道，道法自然。讲究无为而治，不讲究控制，这可能是去中心化的思维。而儒家则讲“现世事功，治国平天下。”，讲主观能动性与控制，这是中心化的思维。在古代最终是儒家掌控了主导权，也确实也把这套思维打造成了一个封闭而又稳定的文化体系。而张小龙要把微信打造成一个动态而又稳定的系统，必然需要在去中心化的基础上，加上中心化的控制与主导。\r\n </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 去中心化的本质是让微信公众平台整个生态形成一个缺乏中心点的森林。微信作为一个封闭生态，让森林万物生长。但偌大的森林会将许多东西包裹隐藏起来，大量内容被抄袭同时，也缺乏一个中心化的流量入口去曝光监控它们。这时候去中心化往往会导致一种失控的局面——各种公众号为在基于找流量为自身创收导致抄袭的泛滥，让原创者生产内容的动力下降，并产生大量的原创内容版权法律纠纷，如果抄袭事件持续发酵导致后续大规模的侵权举报大量发生，伤害到的则是微信品牌本身。所以，去中心化的个体生存所依赖资源的资源越少，越需要控制力。公众号本身是偏媒体属性，媒体属性必须要有门槛。那么在这个基础上，必然需要引入中心化的控制，才能避免整个生态系统的失控。\r\n   </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 但去中心化是互联网界推崇的一种思维，在移动互联网行业，很少有产品能够像微信一样可以真正做到这一步。回到标题的命题，我们可以总结，优质原创内容是否为内容生产者带来利益与微信不是共赢关系，而优质内容是否产生足够多的流量才能与微信产生共赢关系，所以我们看到微信“原创保护”的对象也是针对流量大户：比如首先是认证的媒体或企业公众号，运营时间在1年以上，且有持续的运营规划，且按照原创度、原创文章数、注册时间筛选出符合条件的公众帐号。这套过滤机制几乎将绝大部分公众号挡在了原创保护之外。\r\n  </p>\r\n<p class=\"text\" style=\"box-sizing:border-box;margin-top:0px;margin-bottom:20px;line-height:24px;color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n 因为微信公众平台去中心化的设计，本质是流量生意，每一个公众号个体自己创造或聚拢流量，每一个小的中心都在为整个微信平台大池子贡献流量，各种中心化的个体针对各种原创内容的抄袭转载恰恰让优质内容在公众号之间不断流转，带动了用户活跃度，也带动了整个微信自媒体内容生态圈的繁荣。只有优质内容被持续搬运到流量大户，才能将盘子做大，这符合微信生态设计的愿景，这种顶层设计可能才是微信公众平台抄袭泛滥的原罪。\r\n    </p>',NULL,'qu-zhong-xin-hua-wei-xin-chao-xi-fan-lan-de-yuan-zui',1,0,'2017-04-26 03:00:45','2017-04-26 07:15:15');

/*Table structure for table `li_attrs` */

DROP TABLE IF EXISTS `li_attrs`;

CREATE TABLE `li_attrs` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `filename` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `url` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `li_attrs` */

/*Table structure for table `li_auth_tmps` */

