  `auth_id` char(25) COLLATE utf8_unicode_ci NOT NULL,
  `openid` char(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `overtime` int(11) NOT NULL DEFAULT '0',
  KEY `auth_tmps_auth_id_index` (`auth_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `li_auth_tmps` */

/*Table structure for table `li_brands` */

DROP TABLE IF EXISTS `li_brands`;

CREATE TABLE `li_brands` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '品牌名称',
  `icon` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'icon',
  `describe` varchar(1000) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '描述',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

