/*Table structure for table `li_cards` */

DROP TABLE IF EXISTS `li_cards`;

CREATE TABLE `li_cards` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `card_id` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '会员卡号',
  `card_pwd` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '会员卡密码',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态，0未用 1已用',
  `init_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '使用时间',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `li_cards` */

/*Table structure for table `li_carts` */

DROP TABLE IF EXISTS `li_carts`;

CREATE TABLE `li_carts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `session_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'sessionId',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
