  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `price` varchar(15) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '金额',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型，0消费 1充值',
  `mark` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`,`mark`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

