CREATE TABLE `li_good_attr` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `good_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `good_attr_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品属性id',
  `good_attr_value` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商品属性值',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

