/*Table structure for table `li_good_attrs` */

DROP TABLE IF EXISTS `li_good_attrs`;

CREATE TABLE `li_good_attrs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `good_cate_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品分类',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '属性名称',
  `search_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '索引类型：0不需要检索 1关键字检索 2范围检索',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0唯一属性 1单选属性 2复选属性',
  `input_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 手工录入 1从列表中选择 2多行文本框',
  `value` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '属性值',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

