/*Table structure for table `li_order_goods` */

DROP TABLE IF EXISTS `li_order_goods`;

CREATE TABLE `li_order_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户ID',
